import React, {Component} from 'react'
import './style.css'
import Top from './Top'
import List from './List'
import Bom from './Bom'

class Todo extends Component{
  constructor(props){
    super(props)
    this.state = {
      list: [
        {
          status: 0,
          context: '啊时间的话噶几红烧冬瓜',
        },
        {
          status: 1,
          context: '啊时间的话噶几红烧冬瓜',
        },
      ]
    }
  }
  render(){
    return (
      <div className='todo'>
        <h1>TODO-REACT</h1>
        <div className="con">
          <Top></Top>
          <List list={this.state.list}></List>
          <Bom></Bom>
        </div>
      </div>
    )
  }
}

export default Todo
